\[
\text{To find out how much less Jim walks compared to Martha, we first need to calculate the distances each of them travels.}
\]

\[
\text{1. Calculate the distance Jim travels:}
\]
\[
\text{Jim travels along the diagonal of the rectangle. The formula for the diagonal \(d\) of a rectangle with width \(w\) and length \(l\) is given by:}
\]
\[
d = \sqrt{w^2 + l^2}
\]
\[
\text{Here, the width \(w = 300\) feet and the length \(l = 400\) feet. Plugging in these values:}
\]
\[
d = \sqrt{300^2 + 400^2}
\]
\[
= \sqrt{90000 + 160000}
\]
\[
= \sqrt{250000}
\]
\[
= 500 \text{ feet}
\]

\[
\text{2. Calculate the distance Martha travels:}
\]
\[
\text{Martha walks along the perimeter of the rectangle, which is the sum of the lengths of the two sides:}
\]
\[
\text{Distance} = w + l = 300 + 400 = 700 \text{ feet}
\]

\[
\text{3. Now, find the difference in distance between Martha and Jim:}
\]
\[
\text{Difference} = \text{Distance Martha} - \text{Distance Jim} = 700 - 500 = 200 \text{ feet}
\]

\[
\text{Thus, Jim walks 200 feet less than Martha.}
\]

\[
\boxed{200}
